    "2015-10-29T05:53:33.513417",nt"name": "real-property-assessment-equity-statistics-by-municipality-beginning-2004",nt"isopen":
    false,nt"url": null,nt"notes": "The Department of Taxation and Finance
    annually produces a report documenting the results of the Market Value Survey pertaining
    to property assessment.  The report contains the staff findings regarding assessment
    equity by municipality in New York State, that is, the degree to which assessments
    are at a uniform percentage of their market value.  Equity is measured primarily
    by two statistics u2014 the coefficient of dispersion (COD) and the price-related
    differential (PRD).  For more information please go to:  http://www.tax.ny.gov/research/property/default.htm",nt"license_title":
